import * as React from 'react';

import styles from './projects.module.scss';

import { Block } from 'components';

const Projects: React.FC = () => {
  return (
    <div className={styles.projects}>
      <Block>
        <p className={styles.title}>Projects(3)</p>
      </Block>
    </div>
  );
};

export { Projects };
